import React from 'react';
import Card from './Card';

function CardList({ pets, images }) {

	const defaultPhotos = [];
	images.map((img, i) => {
		if (images[i].defaultPic) {
			defaultPhotos.push(images[i]);
		}
	});

	console.log(defaultPhotos);

	defaultPhotos.map((photo, i) => {
		pets.map((pet, j) => {
			if(defaultPhotos[i].pets_id === pets[j].id) {
				return <Card key={pets[i].id} img={'http://localhost:4412/api/file/' + defaultPhotos[i].url} name={pets[i].name} description={pets[i].description}/>
			}
		});
	});
}

export default CardList;

